package org.springframework.samples.petclinic.owner;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;
import org.springframework.samples.petclinic.owner.Pet;
import org.springframework.samples.petclinic.owner.PetType;

class PetTest {

	private Pet instance;

	@BeforeEach
	void setUp() {
		instance = new Pet();
	}

	@Test
	@DisplayName("Verifies that setBirthDate correctly sets a valid LocalDate and getBirthDate returns it")
	void testSetBirthDateValidDate() {
		var result = instance.setBirthDate(LocalDate.of(2020, 1, 1));
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that setBirthDate can set null and getBirthDate returns null")
	void testSetBirthDateNull() {
		var result = instance.setBirthDate(null);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that getBirthDate returns the value previously set by setBirthDate")
	void testGetBirthDateReturnsSetValue() {
		var result = instance.setBirthDate();
		assertEquals(LocalDate.of(2020, 1, 1), result);
	}

	@Test
	@DisplayName("Verifies that addVisit adds a Visit to the visits collection")
	void testAddVisitAddsToCollection() {
		var result = instance.setBirthDate(new Visit());
		assertNotNull(result);
	}

	@Test
	@DisplayName("Create a Pet object, assume setBirthDate method exists and call setBirthDate(LocalDate.of(1990, 5, 15)), then call getBirthDate and verify it returns the same LocalDate")
	void testGetBirthDateReturnsSetValue() {
		var result = instance.getBirthDate();
		assertEquals(LocalDate.of(1990, 5, 15), result);
	}

	@Test
	@DisplayName("Create a Pet object, assume setBirthDate method exists and call setBirthDate(null), then call getBirthDate and verify it returns null")
	void testGetBirthDateReturnsNull() {
		var result = instance.getBirthDate();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Create a Pet object, assume setBirthDate method exists and call setBirthDate(LocalDate.MIN), then call getBirthDate and verify it returns LocalDate.MIN")
	void testGetBirthDateWithMinimumDate() {
		var result = instance.getBirthDate();
		assertEquals(LocalDate.MIN, result);
	}

	@Test
	@DisplayName("Create a Pet object, assume setBirthDate method exists and call setBirthDate(LocalDate.MAX), then call getBirthDate and verify it returns LocalDate.MAX")
	void testGetBirthDateWithMaximumDate() {
		var result = instance.getBirthDate();
		assertEquals(LocalDate.MAX, result);
	}

	@Test
	@DisplayName("Tests that getType returns null when the internal type field is set to null, handling the null boundary condition")
	void testGetTypeReturnsNullWhenTypeIsNull() {
		var result = instance.getType();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that setType correctly assigns a valid PetType to the Pet instance")
	void testSetTypeWithValidPetType() {
		instance.setType(new Pet());
	}

	@Test
	@DisplayName("Verifies that setType handles null PetType assignment without throwing an exception")
	void testSetTypeWithNullPetType() {
		instance.setType(new Pet());
	}

	@Test
	@DisplayName("Verifies that setType overwrites the previous PetType when set again")
	void testSetTypeTwice() {
		instance.setType(new Pet());
	}

	@Test
	@DisplayName("Verifies that getVisits() returns an empty collection when no visits have been added to the Pet")
	void testGetVisitsReturnsEmptyCollectionWhenNoVisits() {
		var result = instance.getVisits();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that getVisits() returns a collection containing the visits that were added via addVisit()")
	void testGetVisitsReturnsCollectionWithAddedVisits() {
		var result = instance.getVisits();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that getVisits() returns visits in the order they were added via addVisit()")
	void testGetVisitsPreservesOrderOfAddedVisits() {
		var result = instance.getVisits();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that adding a null visit adds null to the visits list.")
	void testAddVisitWithNull() {
		instance.addVisit(null);
	}

}
